package day5;

public class Switch_Case1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num = 10;
		switch (num) {
			case 5:
				System.out.println("5다");
				break;
			case 10:
				System.out.println("10이다");
				break;
			case 15:
				System.out.println("15다");
				break;
			default:
				System.out.println("해당없음");
		}
	}
}
